mutation validateInputField($type: LoginType, $value: String, $ckey: String, $entranceType: EntranceType) {
  validateLoginInput(type: $type, value: $value, ckey: $ckey, entranceType: $entranceType) {
    ...FlowFragment
    __typename
  }
}

fragment FlowFragment on FlowResponse {
  flowId
  currentPlace
  nextStep
  __typename
}

